/*Hero rocket*/

@keyframes rotateBox {
    to {
        transform: rotate(360deg);
    }
}

/*lessons*/
@keyframes pulsing {
  0% {
    -webkit-transform: scale(0.5, 0.5);
    transform: scale(0.5, 0.5)
  }
  50% {
    -webkit-transform: scale(1.0, 1.0);
    transform: scale(1.0, 1.0);
  }
  100% {
    -webkit-transform: scale(0.5, 0.5);
    transform: scale(0.5, 0.5);
  }
}

/*banner*/
@keyframes ripple {
  0% {
    transform: scale(1);
    opacity: 0.75;
  }

  50%,
  100% {
    transform: scale(1.5);
    opacity: 0;
  }
}

