$color: #FA8D50;




.scroll-button {
    position: fixed;
    width: 45px;
    height: 45px;
    background-color: $color;
    border-radius: 22.5px;
    left:98vw;
    bottom: 2vw;
    transform: translateX(-50%);
    margin-left: -22.5px;
    z-index: 45;
    cursor: pointer;
    text-align: center;
    font-size: 35px;
    line-height: 40px;
    color: #FFFFFF;
    transition: rotate 0.5s ease-in-out;

    &:hover {
        color: #FFFFFF;
    }
        &:hover .banner__icon{
            transform: rotate(0deg);
        }

    &::before,
    &::after {
        content: "";
        position: absolute;
        left: 0;
        width: 45px;
        height: 45px;
        border: $color 12px solid;
        opacity: 0.3;
        animation: ripple 3.0s ease-out infinite;
        border-radius: 50%;
        z-index: -1;
    }

    &:after {
        animation-delay: -0.6s;
    }

    &.scroll-button-floating {
        position: fixed;
        bottom: 100px;
        transition: opacity .5s;
        opacity: 0;

        &.visible {
            opacity: 1;
        }
    }
}
.banner__icon{
    width: 100%;
    height: 100%;
    background-color: $color;
    border-radius: 50%;
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
    transform: rotate(-45deg);
    fill: $text-color;
    
    // animation: rotateBox 3.0s ease-out infinite;
}

